import {Component} from "react"
import "./index.css"





class MoviesList extends Component{

    state = {currentMsg : "hi"}

    onSubmit=(event)=>{
        event.preventDefault()
        this.setState({currentMsg:"hello"})
    }

    render(){
        const {currentMsg}  = this.state
        return(
            <div>
                <form>
                    <h1>From</h1>
                    <input type ="input"/>
                    <h1>To</h1>
                    <input type= "input"/>
                    <button type= "submit"
                    className = "button-style" onClick = {this.onSubmit}>Submit</button>
                </form>
                <div>
                    <h1>{currentMsg}</h1>
                </div>
            </div>
        )
    }
}

export default MoviesList
